import React from "react";
import {
  CardImg,
  CardTitle,
  CardSubtitle,
  CardBody,
  CardText,
  Row,
  Col,
  Card,
  Table,
} from "reactstrap";
import styled from "styled-components";
const loginafter = () => {
  const CardTitleSize = styled(CardTitle)`
    font-size: 1.2em;
    font-weight: bold;
    margin-bottom: -1%;
  `;
  const contentsAlert = () => {
    alert("정식오픈해야 열립니다.");
  };
  const WidthPosition = styled.div`
    width: 250%;
  `;
  const Position2 = styled.td`
    width: 300px;
  `;
  return (
    <Table responsive>
      <tr>
        <Position2>
          {" "}
          <WidthPosition>
            <Card
              inverse
              style={{ backgroundColor: "#00D3EE", border: "0px" }}
              onClick={contentsAlert}
            >
              <CardImg
                top
                src={"/image/contents_latte_is_horse.png"}
                alt="Card image cap"
              />
            </Card>
          </WidthPosition>
        </Position2>
        <td>
          <WidthPosition>
            <Card
              inverse
              style={{ backgroundColor: "#00D3EE", border: "0px" }}
              onClick={contentsAlert}
            >
              <CardImg
                top
                width="100%"
                src={"/image/contents_latte_is_horse.png"}
                alt="Card image cap"
              />
            </Card>
          </WidthPosition>
        </td>
        <td>
          <WidthPosition>
            <Card
              inverse
              style={{ backgroundColor: "#00D3EE", border: "0px" }}
              onClick={contentsAlert}
            >
              <CardImg
                top
                widtd="100%"
                src={"/image/contents_latte_is_horse.png"}
                alt="Card image cap"
              />
            </Card>
          </WidthPosition>
        </td>
        <td>
          <WidthPosition>
            <Card
              inverse
              style={{ backgroundColor: "#00D3EE", border: "0px" }}
              onClick={contentsAlert}
            >
              <CardImg
                top
                widtd="100%"
                src={"/image/contents_latte_is_horse.png"}
                alt="Card image cap"
              />
            </Card>
          </WidthPosition>
        </td>
        <td>
          <WidthPosition>
            <Card
              inverse
              style={{ backgroundColor: "#00D3EE", border: "0px" }}
              onClick={contentsAlert}
            >
              <CardImg
                top
                widtd="100%"
                src={"/image/contents_latte_is_horse.png"}
                alt="Card image cap"
              />
            </Card>
          </WidthPosition>
        </td>
        <td>
          <WidthPosition>
            <Card
              inverse
              style={{ backgroundColor: "#00D3EE", border: "0px" }}
              onClick={contentsAlert}
            >
              <CardImg
                top
                widtd="100%"
                src={"/image/contents_latte_is_horse.png"}
                alt="Card image cap"
              />
            </Card>
          </WidthPosition>
        </td>
        <td>
          <WidthPosition>
            <Card
              inverse
              style={{ backgroundColor: "#00D3EE", border: "0px" }}
              onClick={contentsAlert}
            >
              <CardImg
                top
                widtd="100%"
                src={"/image/contents_latte_is_horse.png"}
                alt="Card image cap"
              />
            </Card>
          </WidthPosition>
        </td>
      </tr>
    </Table>
  );
};

export default loginafter;
